      <div className="heading-container">
        <div className='title-container'>
          <h1>Bunnies for dummies</h1>
          <p className='secondary-title'>
            A comprehensive guide to taking care of rabbits
          </p>
        </div>
      </div>
    );
  }

  export default Heading;
